      headers: {
        'X-RapidAPI-Key': 'aae05256b6msh2ccdddba4363d4ep16c4bejsn3a7e7ce3a12e',
        'X-RapidAPI-Host': 'cyber-security-news.p.rapidapi.com'
      }
    };
    
